window.baritoneUkulele = (e="-",b="-",g="-",d="-", f=v=>v) => {
  return stack(
    note(d).add(note("d2")).apply(x=>f(x,0)),
    note(g).add(note("g2")).apply(x=>f(x,1)),
    note(b).add(note("b2")).apply(x=>f(x,2)),
    note(e).add(note("e3")).apply(x=>f(x,3))
  )
}

